		if ((get-aduser $env:USERNAME -properties memberof).memberof -like "*KSS.AppDev*" -or (get-aduser $env:USERNAME -properties memberof).memberof -like "*KSSLeads*")
		{
			$button_Launcher_EditLinks.Visible = $true
		}
