		## test for RSAT/AD tools
		#-----------------------------
		if ($(Test-Path "C:\Windows\system32\dsa.msc") -eq $false)
		{
			[System.Windows.Forms.MessageBox]::Show("AD tools not detected. Have you installed them?", "Status", 4)
		}
		
