	$datagridview_NTFS_AcessList_CellContentDoubleClick=[System.Windows.Forms.DataGridViewCellEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.DataGridViewCellEventArgs]
		#TODO: Place custom script here
		$Error.Clear()
		$textbox_NTFS_ADGroupApproval.Clear()
		$textbox_NTFS_ADGroup.Clear()
		$textbox_NTFS_ADGroupOwnerEmail.Clear()
		$richtextbox_NTFS_OwnerInfoError.Clear
		
		try
		{
			$group = $datagridview_NTFS_AcessList.SelectedRows.Cells[2].FormattedValue -replace "Kiewitplaza", ""
			$group = $group -replace "\\", ""
			$group_info = Get-ADGroup $group -Properties managedBy, description
			
			$textbox_NTFS_ADGroup.Text = $group_info.name
			$textbox_NTFS_ADGroupOwnerEmail.Text = $(Get-ADUser $group_info.managedby -Properties mail).mail
			
			$none = "*None*"
			$Required = "*Required*"
			$Notify = "*Notify*"
			
			if ($group_info.description -like $Notify)
			{
				$group_approval = "Notify"
			}
			elseif ($group_info.description -like $Required)
			{
				$group_approval = "Required"
			}
			elseif ($group_info.description -like $none)
			{
				$group_approval = "None"
			}
			else
			{
				$group_approval = "Approval info not found"
			}
			
			$textbox_NTFS_ADGroupApproval.Text = $group_approval
		}
		catch
		{
			$richtextbox_NTFS_OwnerInfoError.Text = $Error.Exception.Message
		}
	}
	
