	$button_Account_Unlock_Click={
		#TODO: Place custom script here
		
		$richtextbox_Account_UnlockOutput.Visible = $true
		
		if ($textbox_Account_sAMAccountName -ne $null)
		{
			unlock-adaccount -identity $textbox_Account_sAMAccountName -Server knedcxiwp002  
			$lockedstill = Get-ADUser $textbox_Account_sAMAccountName -server knedcxiwp002 –properties lockedout | Select-Object lockedout
			$sleep
			If ($lockedstill.lockedout -eq $true)
			{
				$richtextbox_Account_UnlockOutput.Text = "Unlock failed. Please try again with ADUC."
			}
			else
			{
				$richtextbox_Account_UnlockOutput.Text = "User unlocked on PDC. Auto unlock script will run for 10 min."
				$textbox_Account_LockConfirmation.ForeColor = 'Black'
				$textbox_Account_LockConfirmation.Text = "Not Locked"
			}
			
			#-----------------------------
			# unlocking on all DCs
			#-----------------------------
			Start-Process .\bin\unlock.exe -argumentlist $textbox_Account_sAMAccountName  
			
			#-----------------------------
			# continue to unlock for 5 minutes
			#-----------------------------
			$code = {
				$i = 0
				do
				{
					unlock-adaccount -identity $textbox_Account_sAMAccountName  
					sleep -Seconds 5
					$i = $i + 1
				}
				until ($i -eq "120")
			}
			
			Start-Job $code
		}
		else
		{
			$richtextbox_Account_UnlockOutput.Text = "Please enter a name of a user to unlock."
		}
		
		#-----------------------------
		## writing to log file
		#-----------------------------
		$LogTimeStampCurrent = Get-Date -UFormat "%b%e %Y-%H%M"
		Log-Write -LogPath $LogFile -LineValue "$LogTimeStampCurrent :: Unlocked user account"
		Log-Write -LogPath $LogFile -LineValue $properties.name
		Log-Write -LogPath $LogFile -LineValue "***************************************************************************************************"
		
		Log-Write -LogPath $logusagefile -LineValue "$LogTimeStampCurrent, $userName, $pcname, Unlocked user account"
		
	}
	
