	#-----------------------------
	#  function to get get AD object info
	#-----------------------------
	function Get-ADAccountType
	{
		[CmdletBinding()]
		param (
			$adobject
		)
		
		begin
		{
			
		}
		
		Process
		{
			if ($adobject -gt "0" -and $adobject -lt "999999")
			{
				$objecttype = Get-ADUser -filter { employeeid -like $adobject -and name -notlike "*admin" } -Properties extensionAttribute12, CanonicalName, objectclass, givenname, sn, displayname, title, manager, employeeID, company, mail, ipphone, mobile, physicalDeliveryOfficeName, lockoutTime, enabled, accountExpirationdate, directreports, passwordlastset, whenCreated, whenChanged, memberof
			}
			else
			{
				$objecttype = Get-ADObject -filter { name -eq $adobject } -Properties extensionAttribute12, CanonicalName, objectclass, givenname, sn, displayname, title, manager, employeeID, company, mail, ipphone, mobile, physicalDeliveryOfficeName, lockoutTime, enabled, directreports, whenCreated, whenChanged, memberof
			}
			
			if ($objecttype.objectclass -eq "user")
			{
				
				if ($objecttype.extensionAttribute12 -eq "MBX=ST;TYPE=SHARED;")
				{
					write-output "This is a Shared Mailbox"
					$objectlist = $objecttype | format-list | Out-String
				}
				elseif (($objecttype.extensionAttribute12 -like "*RESMBX=roomrba;") -or ($objecttype.extensionAttribute12 -like "*TYPE=RESOURCE*"))
				{
					write-output "This is a Conference Room"
					$objectlist = $objecttype | format-list | Out-String
				}
				else
				{
					$objecttype = Get-ADUser -filter { name -eq $adobject } -Properties accountExpirationdate, passwordlastset
					write-output "This is a User account"
					$objectlist = $objecttype | format-list | Out-String
				}
				
			}
			elseif ($objecttype.objectclass -eq "contact")
			{
				write-output "This is a Contact"
				$objectlist = $objecttype | format-list | Out-String
			}
			elseif ($objecttype.objectclass -eq "computer")
			{
				write-output "This is a Computer account"
				$objectlist = $objecttype | format-list | Out-String
			}
			elseif ($objecttype.objectclass -eq "group")
			{
				write-output "This is a Group"
				$objectlist = $objecttype | format-list | Out-String
			}
		}
		
		end
		{
			
		}
	}
	
