	$form_Launcher_EditLink_Load={
		#TODO: Initialize Form Controls here
	
		$LinkNames = (Get-ChildItem $lib\launcher\ -Recurse).BaseName
		Update-ComboBox $combobox_LinkName $LinkNames
	}
	
	$combobox_LinkName_SelectedIndexChanged={
		#TODO: Place custom script here
		$textbox_Name.Text = $combobox_LinkName.Text
		
		$inicontent = get-inicontent "$lib\Launcher\$($textbox_Name.Text).ini"
		
		if ($inicontent.Link.Type -eq "URL")
		{
			$radiobutton_URL.Checked = $true
		}
		else
		{
			$radiobutton_Application.Checked = $true
		}
		
		$textbox_Link.Text = $inicontent.Link.Link
		$combobox_Group.Text = $inicontent.Link.Group
		
	}
	
	$buttonAdd_Click = {
		#TODO: Place custom script here
		
		if ($radiobutton_URL.Checked -eq $true -and ($textbox_Link.Text.StartsWith("http") -or $textbox_Link.Text.StartsWith("www.") ) )
		{
			Copy-Item $textbox_Image.Text "$lib\Launcher\Images\tester.png" -Force
			
			
			$new_link = @{ "Name" = $textbox_Name.Text; "Link" = $textbox_Link.Text; "Group" = $combobox_Group.Text; "Type" = "URL" }
			$inicontent = @{ "Link" = $new_link }
			Out-IniFile -filepath "$lib\Launcher\$($textbox_Name.Text).ini" -InputObject $inicontent -Force
		}
		else
		{
			$textbox_Link.Text = "Type selected does not match up with Link given."
		}
		
	}
	$buttonBrowse_Click={
	
		if($openfiledialog1.ShowDialog() -eq 'OK')
		{
			$textbox_Image.Text = $openfiledialog1.FileName
		}
	}
	
